import React, { Component } from 'react';
import styled from 'styled-components';

/**STYLE COMPONET CSS HERE */
const LeftSidebar = styled.div`
width: 260px;
height: 100%;
position: fixed;
top: 0;
left: 0;
border: none;
bottom: 0;
z-index: 1;
box-shadow: 0 10px 30px -12px rgba(0, 0, 0, 0.42), 0 4px 25px 0px rgba(0, 0, 0, 0.12), 0 8px 10px -5px rgba(0, 0, 0, 0.2);
right: auto;
overflow-y: auto;
flex-direction: column;
display: flex;
outline: none;
flex: 1 0 auto;
`;

const Logo = styled.div`
padding: 15px 15px;
z-index: 4;
position: relative;
`;

const LinkImg = styled.a`
color: #FFF;
display: block;
padding: 5px 0;
font-size: 18px;
text-align: left;
font-family: "Roboto", "Helvetica", "Arial", sans-serif;
font-weight: 400;
line-height: 30px;
text-transform: uppercase;
text-decoration: none;
background-color: transparent;
`;

const InSideLinkDiv = styled.div`
width: 30px;
display: inline-block;
max-height: 30px;
margin-left: 10px;
margin-right: 15px;
`;

const Icon = styled.img`
top: 22px;
width: 35px;
border: 0;
position: absolute;
vertical-align: middle;
`;

class Dashboard extends Component {
  logout(){
    sessionStorage.removeItem('formData');
    this.props.history.push("/");
  }

  render() {
    return (
      <div >
        {/* <nav>
          <button className="btn btn-primary" onClick={this.logout.bind(this)}>Logout</button>
        </nav> */}
        {/* <h2>Welcome to HomePage</h2> */}
        <LeftSidebar>
            <Logo>
              <LinkImg href="#">
                <InSideLinkDiv>
                  <Icon src="https://img.icons8.com/color/48/000000/maxcdn.png"/>
                </InSideLinkDiv>
                Creative Tim
              </LinkImg>
            </Logo>
        </LeftSidebar>
      </div>
    );
  }
 
}
export default Dashboard;
